import React, { Component } from "react";

class NavBar extends Component {
  render() {
    return (
      <nav className="navbar navbar-dark bg-dark">
        <a class="navbar-brand" href="#">
          Focus
        </a>
      </nav>
    );
  }
}

export default NavBar;
